import React from 'react';
import './styles.css';
import { Link } from 'react-router-dom';
import data from './data';
import ShoppingList from './ShoppingList'

export class AllShoppingLists extends React.Component {
    render() {
        return(
            <section className="listoflists">
                <h1>Shopping Lists</h1>
                    {data.map(listName => (
                            <ShoppingList
                            key={listName.name}
                            name={listName.name}
                        />
                    ))}
                </section>
        );
    }

}
export default AllShoppingLists;
